import React, { Component } from 'react';
import './App.css';
import axios from 'axios';

export default class App extends Component {


  componentDidMount(){
    this.getmygithub()
  }

  getmygithub = () => {

    axios.get('https://api.github.com/users/trickascp/repos')
    .then((res) => {
      console.log(res.data)
    })

  }

  render(){

    return(
      <div>Hello</div>
    ) 

  }

}
